  return (
    <>
      <Row style={{ paddingTop: `75px` }} className="footer">
        <Col
          xs={{ span: 14, offset: 7 }}
          sm={{ span: 10, offset: 7 }}
          md={{ span: 8, offset: 9 }}
          lg={{ span: 8, offset: 9 }}
